import React, { useEffect, useState } from 'react'

export default function TotalPickups() {
    const [data, setData] = useState([]);

    useEffect(() => {
      fetch("http://localhost:8085/waste-details/orders")
        .then((res) => res.json())
        .then((val) => {
          setData(val);
          console.log(val);
        })
        .catch((err) => console.log("Unable to fetch", err));
    }, []); 
  
    return (
      <>
      <h1 className='emph1'>Pickup Data</h1>
      <div className='backsize ' >
        <table className="table">
          <thead>
            <tr>
              <th scope="col">Farmer Id</th>
              <th scope="col">Name</th>
              <th scope="col">Waste Type</th>
              <th scope="col">Quantity</th>
              <th scope="col">Date Of Pickup</th>
              
            </tr>
          </thead>
          <tbody>
            {data && data.length > 0 &&
              data.map((val, index) => {
                return (
                  <tr key={index}>
                    <th scope="row">{val.id}</th> 
                    <td>{val.name}</td>
                    <td>{val.email}</td>
                    <td>{val.mobileNo}</td>
                    <td>{val.wasteType}</td>
                    <td>{val.address}</td>
                    
                  </tr>
                );
              })
            }
          </tbody>
        </table>
      </div>
      </>
    )
}
